import React from "react";

const Notifications = () => {
  return (
    <div className="py-5 text-center">
      <h2>Notifications</h2>
      <p>This is the Notifications module. Get notified on new announcements, grades, etc. here.</p>
    </div>
  );
};

export default Notifications;
